import { GoogleMap, InfoWindow, LoadScript, Marker } from "@react-google-maps/api";
import React, { useState } from 'react';
import { Navigate, Route, BrowserRouter as Router, Routes } from 'react-router-dom';
import About from './components/About';
import Contact from './components/Contact';
import Header from './components/Header';
import Home from './components/Home';
import Login from './components/Login';
import MyMapComponent from './components/MyMapComponent';
import Profile from './components/Profile';

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false); // State to manage login status
  const [showMap, setShowMap] = useState(false); // State to manage map visibility

  const mapContainerStyle = {
    height: "400px",
    width: "800px"
  };

  const center = {
    lat: -34.397,
    lng: 150.644
  };

  const validUsername = 'user';
  const validPassword = 'password';

  const handleMapClick = () => {
    setShowMap(true); // Show the map when the button is clicked
  };

  const handleHideMapClick = () => {
    setShowMap(false); // Hide the map when the button is clicked
  };

  const handleLogin = (username, password) => {
    // Check if the username and password match the predefined values
    if (username === validUsername && password === validPassword) {
      setIsLoggedIn(true);
    } else {
      alert('Invalid username or password');
    }
  };

  const handleLogout = () => {
    setIsLoggedIn(false);
    setShowMap(false); // Hide the map when logging out
  };

  return (
    <div>
      <Router>
        <Header />
        <Routes>
          {/* Protected route for home page */}
          <Route path="/home" element={isLoggedIn ? <Home /> : <Navigate to="/login" />} />
          <Route path="/about" element={isLoggedIn ? <About /> : <Navigate to="/login" />} />
          <Route path="/contact" element={isLoggedIn ? <Contact /> : <Navigate to="/login" />} />
          <Route path="/profile" element={isLoggedIn ? <Profile /> : <Navigate to="/login" />} />
          <Route path="/map" element={isLoggedIn ? <MyMapComponent /> : <Navigate to="/login" />} />
          <Route path="/login" element={<Login onLogin={handleLogin} />} />
          <Route path="/" element={isLoggedIn ? <Home /> : <Navigate to="/login" />} />
        </Routes>
      </Router>

      {isLoggedIn && ( // Conditionally render the buttons only if logged in
        <>
          <button onClick={handleMapClick}>Show Map</button> {/* Button to show the map */}
          <button onClick={handleHideMapClick}>Hide Map</button> {/* Button to hide the map */}
        </>
      )}

      {showMap && ( // Conditional rendering of the map
        <LoadScript googleMapsApiKey="AIzaSyC1h_ObXgGBpji0Z2koTTQp5qhPbvmUckc">
          <GoogleMap
            mapContainerStyle={mapContainerStyle}
            center={center}
            zoom={14}
          >
            <Marker position={center} />
            <InfoWindow position={center}>
              <div>Info Window Content</div>
            </InfoWindow>
          </GoogleMap>
        </LoadScript>
      )}

      {isLoggedIn && <button onClick={handleLogout}>Logout</button>} {/* Logout button */}
    </div>
  );
}

export default App;
